import React from "react";
import Navprofile from "./Components/navprofile/Navprofile";
import { Box } from "@mui/system";
import { Grid } from "@mui/material";
const Test = () => {
  return (
    <div
      style={{
        backgroundColor: "red",
        display: "flex",
        justifyItems: "column",
        width: "200vh",
        height: "1050px",
      }}
    >
      <div
        style={{
          backgroundColor: "yellow",
          width: "85px",
          maxWidth: "300px",
          position: "fixed",
        }}
      >
        <Navprofile />
      </div>

      <div
        style={{
          backgroundColor: "green",
          width: "200vh",
          display: "flex",
          justifyContent: "row",
        }}
      >
        <div
          style={{
            backgroundColor: "red",
            width: "200vh",
            display: "flex",
            height: "80px",
            //position: "fixed",
          }}
        ></div>
      </div>
    </div>
  );
};

export default Test;
